import React from 'react'
import footerImg from '../../images_files/footer-banner.jpg'
const Footer = () => {
  return (
    <footer className="main-footer">
      <div className='container'>
        <div className='row'>
        <div className='col-md-12' align="center">
            <p>Florida Fashion &copy; 2022 All Rights Reserved</p>
          {/* <img src={footerImg} alt={"Florida Fashion"}/> */}
        </div>
        </div>
      </div>
  </footer>
  )
}

export default Footer;
